export default function WorkHistoryContainer(props) {
    let counter = 1
    const element = props.projects.map(project => {
        if(counter%2===1){
            let classID = "project-even"
        } else {
            let classID = "project-odd"
        }
        <li className={classID}>{project.index}</li>
    })
    return(<ul className="workHistory">{element}</ul>);
}
